pragma solidity ^0.4.2;

contract Patient {    
    string public gender;
    uint public dateOfBirth;
    string public medicalHistory;
    uint public breath;
    uint public bloodPressure;
    uint public weight;
    uint public pulse;
    uint public temperature;
    string public description;
    address public doctor;
    address public hospital;
    constructor(string _gender, uint _dateOfBirth,string _medicalHistory,
        uint _breath, uint _bloodPressure, uint _weight, uint _pulse, uint _temperature,
        string _description, address _doctor, address _hospital
    ) public {
        gender = _gender;
        dateOfBirth = _dateOfBirth;
        medicalHistory = _medicalHistory;
        breath = _breath;
        bloodPressure = _bloodPressure;
        weight = _weight;
        pulse = _pulse;
        temperature = _temperature;
        description = _description;
        doctor = _doctor;
        hospital = _hospital;
    }
        
}
